import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';
import { AuthProvider } from './contexts/AuthContext';
import Layout from './components/Layout';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import Profile from './pages/Profile';
import Schemes from './pages/Schemes';
import SchemeDetails from './pages/SchemeDetails';
import Documents from './pages/Documents';
import DocumentsTextView from './pages/DocumentsTextView';
import AadhaarCard from './pages/AadhaarCard';
import PANCard from './pages/PANCard';
import DrivingLicense from './pages/DrivingLicense';
import Passport from './pages/Passport';
import { useAuth } from './contexts/AuthContext';

// Protected Route Component
const ProtectedRoute: React.FC<{ children: React.ReactNode }> = ({ children }) => {
  const { user, loading } = useAuth();
  
  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }
  
  return user ? <>{children}</> : <Navigate to="/login" replace />;
};

// Main App Component
const AppContent: React.FC = () => {
  const { user } = useAuth();

  return (
    <div className="min-h-screen bg-gray-50">
      <Routes>
        <Route path="/login" element={!user ? <Login /> : <Navigate to="/dashboard" replace />} />
        <Route path="/" element={<Navigate to={user ? "/dashboard" : "/login"} replace />} />
        
        {/* Protected Routes */}
        <Route path="/dashboard" element={
          <ProtectedRoute>
            <Layout>
              <Dashboard />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/profile" element={
          <ProtectedRoute>
            <Layout>
              <Profile />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/schemes" element={
          <ProtectedRoute>
            <Layout>
              <Schemes />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/schemes/:id" element={
          <ProtectedRoute>
            <Layout>
              <SchemeDetails />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/documents" element={
          <ProtectedRoute>
            <Layout>
              <Documents />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/documents/text-view" element={
          <ProtectedRoute>
            <Layout>
              <DocumentsTextView />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/documents/aadhaar" element={
          <ProtectedRoute>
            <Layout>
              <AadhaarCard />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/documents/pan" element={
          <ProtectedRoute>
            <Layout>
              <PANCard />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/documents/drivingLicense" element={
          <ProtectedRoute>
            <Layout>
              <DrivingLicense />
            </Layout>
          </ProtectedRoute>
        } />
        
        <Route path="/documents/passport" element={
          <ProtectedRoute>
            <Layout>
              <Passport />
            </Layout>
          </ProtectedRoute>
        } />
        
        {/* Catch all route */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
      
      <Toaster
        position="top-center"
        reverseOrder={false}
        gutter={8}
        containerClassName=""
        containerStyle={{}}
        toastOptions={{
          duration: 4000,
          style: {
            background: '#363636',
            color: '#fff',
            borderRadius: '8px',
            fontSize: '14px',
            maxWidth: '500px',
          },
          success: {
            style: {
              background: '#10B981',
            },
          },
          error: {
            style: {
              background: '#EF4444',
            },
          },
        }}
      />
    </div>
  );
};

// Root App Component
const App: React.FC = () => {
  return (
    <AuthProvider>
      <Router>
        <AppContent />
      </Router>
    </AuthProvider>
  );
};

export default App;
